import React from 'react';

const LoadingFallback = ({ message = "Loading..." }) => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-shrine-white">
      <div className="text-center">
        <div className="w-16 h-16 mx-auto mb-4 relative">
          {/* Fox-themed loading animation */}
          <div className="w-16 h-16 rounded-full border-4 border-shrine-gold border-t-shrine-red animate-spin"></div>
          <div className="absolute inset-0 flex items-center justify-center">
            <span className="text-2xl">ðŸ¦Š</span>
          </div>
        </div>
        <p className="text-shrine-dark font-cinzel text-lg">{message}</p>
        <div className="flex justify-center mt-2">
          <div className="flex space-x-1">
            <div className="w-2 h-2 bg-shrine-red rounded-full animate-bounce"></div>
            <div className="w-2 h-2 bg-shrine-gold rounded-full animate-bounce" style={{ animationDelay: '0.1s' }}></div>
            <div className="w-2 h-2 bg-fox-orange rounded-full animate-bounce" style={{ animationDelay: '0.2s' }}></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoadingFallback;
